// Dependencies.
import React from 'react';

// Component 'Projects'.
function Projects() {
    return (
        // Projects Container.
        <div id="MyProjects">
            <div id="ProjectsSection">
                <h1 className="text-white">This is a test!</h1>
            </div>
        </div>
    );
}

// Do export.
export default Projects;
